This is the complete run of Rick Remender's Venom v2, featuring Flash Thompson as a new black ops Venom controlled by the government. Venom has always been more of an anti-hero than a true villain, and Remender explores the duality of the symbiote's aggressiveness and need to bond versus Flash's attempts to hold on to his humanity and sometimes shattered psyche. The series also has some suitably dark and twisted artwork from Tony Moore and others. All issues are digital; the first 35 are by Minutemen-Phd and the remaining are by Nahga-Empire. Thanks to them for these awesome copies; please seed and enjoy! :-)
